import styled from "styled-components";

const WrapBox = styled.div`
  background: linear-gradient(to bottom, #000000, #4f4f51);
  background-size: cover;
  min-height: 200vh;
  height: 100%;
  max-width: 1600px;
  margin: 0 auto;
  padding-top:117.5px;
  z-index:2;
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
`;

export default WrapBox
